import './App.css'

function ArticleLists(props){
    const articleList = props.data;
    const articles = articleList && articleList.map((article, index) => {
        return <div key={index}>
                    <span>{article[index]}</span>
                    <br/>
               </div>
    });


    return (
        <div>
            Board Data(Text â†’ JSON) :
            <div id="article"> 
            {articles.array.forEach(element => {
                articles[element];
            })} 
            </div>
        </div>
    )
}

export default ArticleLists;
